import{projectsData}from"./data-projects.min.js";function projectsPosts(t){const s=document.getElementById("works");for(let e=0;e<t.length;e++){let i=document.createElement("article");i.classList.add("works__item"),i.innerHTML=`\n        <div class="img-box">\n            <a href="article${t[e].id}.html" class="works__image _ibg">\n                <img src="${t[e].imageSrc}" alt="${t[e].imageAlt}">\n            </a>\n        </div>\n        <div class="works__body">\n            <a href="article${t[e].id}.html" class="works__title">${t[e].title}</a>\n            <div class="works__info">\n                <div class="works__year">${t[e].date}</div>\n                <div class="works__category">${t[e].category}</div>\n            </div>\n            <div class="works__text text">\n            ${t[e].description}\n            </div>\n        </div>\n        `,s.appendChild(i)}}projectsPosts(projectsData);